INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (1, 0.0, 4, 0.0, 4, "2030/12/17 14:59:59", 0.0, 24015, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (2, 0.0, 1, 0.0, 4, "2030/12/17 14:59:59", 4.0, 24016, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (3, 0.0, 4, 0.0, 4, "2030/12/17 14:59:59", 0.0, 24017, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (4, 0.0, 2, 0.0, 1, "2030/12/17 14:59:59", 5.2, 24018, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (5, 0.0, 6, 0.0, 5, "2030/12/17 14:59:59", 4.2, 24019, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (6, 0.0, 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, 24020, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (7, 0.0, 6, 0.0, 1, "2030/12/17 14:59:59", 6.4, 24021, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (8, 0.0, 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, 24022, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (9, 0.0, 3, 0.0, 6, "2030/12/17 14:59:59", 10.08, 24023, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10, 0.0, 2, 0.0, 1, "2030/12/17 14:59:59", 5.0, 24024, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 10021);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (11, 0.0, 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, 24025, "2019/07/31 12:00:00", "カオリ（サマー）", 110501, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 10021);
